import React, { useState } from 'react';
import { withCookies, useCookies } from "react-cookie";
import jwt from 'jwt-decode';
import Stack from '@mui/material/Stack';
import FormControl from '@mui/material/FormControl';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import request from 'axios';

function SignupForm(props) {
  const [username, setUsername] = useState('Cat');
  const [password, setPassword] = useState('Password');
  const [email, setEmail] = useState('email');
  const [cookies, setCookie] = useCookies();


  const handleUsernameChange = (e) => {
    setUsername(e.target.value);
  }

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  }

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  }

  const handleSubmitButton = async () => {
    console.log(cookies);
    const jwtToken = cookies.token;
    console.log('Jwt token is');
    console.log(JSON.stringify(jwtToken));
    const { username } = await jwt(jwtToken);
    console.log('Jwt token decoded is');
    console.log(username);
    // const credentials = {
    //   username:usernameInput.current.value,
    //   password: passwordInput.current.value,
    //   email: emailInput.current.value,
    // };
    // const res = await request.post("http://localhost:8080/signin", credentials, {
    //   withCredentials: true,
    // });
    // console.log(res)
  };

  return (
    <form className="SignupForm">
      <FormControl>
        <TextField type="text" label="Username" value={username} onChange={handleUsernameChange} />
      </FormControl>
      <FormControl>
        <TextField type="text" label="Password" value={password} onChange={handlePasswordChange} />
      </FormControl>
      <FormControl>
        <TextField type="text" label="Email" value={email} onChange={handleEmailChange} />
      </FormControl>
      <FormControl>
        <Button variant="contained" type="submit" onClick={handleSubmitButton}>Submit</Button>
      </FormControl>
    </form>
  );
}

export default withCookies(SignupForm);
